    false,nt"url": null,nt"notes": "The Oregon Department of Geology & Mineral
    Industries (DOGAMI) contracted with Watershed Sciences, Inc. to collect high resolution
    topographic LiDAR data for multiple areas within the State of Oregon. The areas
    for LiDAR collection have been designed as part of a collaborative effort of state,
    federal, and local agencies in order to meet a wide range of project goals. This
    LiDAR data set was collected over 6 deliveries from Oct 8, 2009 through Sept 6,
    2010 and encompasses portions of Crook, Deschutes, Jefferson, Klamath, and Lake
    counties in Oregon. This data set consists of bare earth and unclassified points.
    The average pulse density is 9.4 pulses per square meter over terrestrial surfaces.
    The Deschutes data set in its entirety (available from DOGAMI) consists of 17 delivery
    areas which total 3001 square miles (1,920,429 acres) and the total area flown (TAF)
    covers 3053 square miles (1,953,949 acres). The TAF acreage is greater than the
    original AOI acreage due to buffering and flight planning optimization. Please note
    however, that the data available from NOAA OCM covers a smaller area because it
    only contains the data for six of the Delivery Areas. They are Delivery Areas 8,
    9, 10, 11, 12, and 13. This metadata record reflects the cumulative statistics for
    the overall lidar survey. In some areas of heavy vegetation or forest cover, there
    may be relatively few ground points in the LiDAR data. Elevation values for open
    water surfaces are not valid elevation values because few LiDAR points are returned
    from water surfaces. LiDAR intensity values were also collected. Dates of acquisition
    for the six deliveries that make up this data set. Delivery Area Acquisition Dates
